"""# New Prophet Vizualisation

Load and visualise the historical data
"""

import pandas as pd
import matplotlib.pyplot as plt

# load the dataset but for Prophet you need 'DS' -date and 'y' for us is BTC_Close
df_prophet = re_merged_df[['BTC_Close']].reset_index()
df_prophet.columns = ['ds', 'y']

#convert ds into dattime
df_prophet['ds'] = pd.to_datetime(df_prophet['ds'])

# plotting historical BTC prices
plt.figure(figsize =(12, 6))
plt.plot(df_prophet['ds'], df_prophet['y'], label='The actual BTC Price')
plt.xlabel('Date')
plt.ylabel('BTC Price')
plt.title('Historical BTC Price')
plt.legend()
plt.show()

"""Splitting data into Training and Testing - last year for testing"""

# sorting by day
df_prophet = df_prophet.sort_values('ds')

# defining the cutt off - 1 year before the last available data
cutoff_date = df_prophet['ds'].max() - pd.Timedelta(days=365)

# training set => all data before the cuttoff date
train_df = df_prophet[df_prophet['ds'] < cutoff_date]


#test set => last 365 days
test_df = df_prophet[df_prophet['ds'] >=cutoff_date]

#verifying the train-test split
print(f'Train data last 5 rows: {train_df.tail()}')
print(f'Test data first 5 rows: {test_df.head()}')

"""Train Prophet and Forcast the last year"""

from prophet import Prophet

#initilizing the model
model = Prophet()
model.fit(train_df)

# creating future datafram for prediction (same as the test set)
future = model.make_future_dataframe(periods=len(test_df))

# generate forcasst
forecast = model.predict(future)

# extract only the last 365 (test period)
forecast_test = forecast[forecast['ds'].isin(test_df['ds'])]

# check forcasted values
print(forecast_test[['ds', 'yhat']].head())

# Plot actual vs predicted prices
plt.figure(figsize=(12, 6))
plt.plot(test_df['ds'], test_df['y'], label="Actual BTC Price", color='blue')
plt.plot(forecast_test['ds'], forecast_test['yhat'], label="Predicted BTC Price", color='red')
plt.fill_between(forecast_test['ds'], forecast_test['yhat_lower'], forecast_test['yhat_upper'], color='pink', alpha=0.3)
plt.xlabel("Date")
plt.ylabel("BTC Price")
plt.title("Actual vs Predicted BTC Price (Last Year)")
plt.legend()
plt.show()

from sklearn.metrics import r2_score, mean_squared_error
import numpy as np

# Extract actual vs predicted values
y_true = test_df['y'].values  # Actual values
y_pred = forecast_test['yhat'].values  # Predicted values

# Compute R² Score
r_squared = r2_score(y_true, y_pred)

# Compute RMSE
rmse = np.sqrt(mean_squared_error(y_true, y_pred))

print(f"📈 R² Score: {r_squared:.4f}")  # Closer to 1 is better
print(f"📉 RMSE: {rmse:.2f}")  # Lower is better

