for i, (event, date) in enumerate(event_dates.items()):
    if date >= pd.to_datetime("2015-01-01"):  # Only plot events after 2015
        ax.axvline(x=date, color='red', linestyle='--', alpha=0.7)

        # Alternate text positions to prevent overlap
        ypos = df['BTC_Close'].max() * (0.85 if i % 2 == 0 else 0.75)
