"""why are lagged features useful? ❓ 🤔  🤔 => they are good when you belive that past values of variables influence current or feature outcomes \
eg BTC's price increase on day => ETH s price MIGHT follow suit the next day
OR S&P 500 falls, it might take crypto some time to react \

`.shift(1)` function shifts the data down `by 1 row => moving every value of a column one (
"""

